import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { getNoteById, updateNote } from '../../services/notesService';
import { getUsers } from '../../services/userService'; // Assuming we have a service to get all users

const MinuteNoteDetail = () => {
  const { id } = useParams();
  const [note, setNote] = useState(null);
  const [allUsers, setAllUsers] = useState([]); // To store all users from the API
  const [selectedAttendees, setSelectedAttendees] = useState([]); // Store selected attendees
  const [isSaved, setIsSaved] = useState(false); // To track if changes are saved
  const navigate = useNavigate();

  useEffect(() => {
    const fetchNoteAndUsers = async () => {
      try {
        // Fetch note by ID
        const noteResponse = await getNoteById(id);
        const noteData = noteResponse.data;
        setNote(noteData);

        // Fetch all users to display in the checklist
        const usersResponse = await getUsers();
        setAllUsers(usersResponse.data);

        // Initialize the selected attendees based on the note's existing attendees
        if (Array.isArray(noteData.attendees)) {
          setSelectedAttendees(noteData.attendees);
        }
      } catch (err) {
        console.error('Error fetching note or users:', err);
      }
    };

    fetchNoteAndUsers();
  }, [id]);

  const handleEdit = () => {
    navigate(`/minute_note_edit/${id}`);
  };

  const handleSubmitForApproval = async () => {
    try {
      await updateNote(id, { submitted: true });
      alert('Note submitted for approval!');
    } catch (err) {
      console.error('Error submitting note:', err);
    }
  };

  const handleAttendeeChange = (userId) => {
    setSelectedAttendees((prevAttendees) => {
      if (prevAttendees.includes(userId)) {
        return prevAttendees.filter((attendee) => attendee !== userId); // Remove attendee
      } else {
        return [...prevAttendees, userId]; // Add attendee
      }
    });
  };

  const handleSaveChanges = async () => {
    try {
      await updateNote(id, { attendees: selectedAttendees });
      setIsSaved(true); // Disable editing after saving
      alert('Attendees updated successfully!');
    } catch (err) {
      console.error('Error saving attendees:', err);
    }
  };

  if (!note) return <div>Loading...</div>;

  return (
    <div style={{ padding: '20px', fontFamily: 'Segoe UI, sans-serif' }}>
      <h1 style={{ fontStyle: 'italic', fontWeight: 'normal' }}>{note.title}</h1>

      <p style={{
        backgroundColor: '#e0ecff',
        padding: '20px',
        borderRadius: '10px',
        fontStyle: 'italic',
        minWidth: '400px',
        minHeight: '100px',
        width: 'fit-content',
        maxWidth: '600px',
        marginBottom: '20px'
      }}>
        {note.content}
      </p>

      <h3 style={{ marginTop: '20px' }}>Attendees:</h3>
      <ul style={{ listStyleType: 'none', paddingLeft: '0' }}>
        {allUsers.length > 0 ? (
          allUsers.map((user) => (
            <li key={user.id} style={{ marginBottom: '10px' }}>
              <label style={{ fontStyle: 'italic' }}>
                <input
                  type="checkbox"
                  checked={selectedAttendees.includes(user.id)}
                  onChange={() => handleAttendeeChange(user.id)}
                  disabled={isSaved} // Disable if changes are saved
                  style={{ marginRight: '10px' }}
                />
                {user.firstName} {user.lastName}
              </label>
            </li>
          ))
        ) : (
          <li>No users available to select from.</li>
        )}
      </ul>

      <div style={{ marginTop: '20px', display: 'flex', gap: '10px' }}>
        <button
          onClick={handleEdit}
          style={{
            backgroundColor: '#d9d9d9',
            border: 'none',
            borderRadius: '10px',
            padding: '6px 12px',
            cursor: 'pointer'
          }}
        >
          Edit
        </button>

        <button
          onClick={handleSubmitForApproval}
          style={{
            backgroundColor: '#b4d8f7',
            border: 'none',
            borderRadius: '10px',
            padding: '6px 12px',
            cursor: 'pointer'
          }}
        >
          Send for Approval
        </button>

        <button
          onClick={handleSaveChanges}
          style={{
            backgroundColor: '#6fa4f7',
            border: 'none',
            borderRadius: '10px',
            padding: '6px 12px',
            cursor: 'pointer'
          }}
          disabled={isSaved} // Disable if already saved
        >
          Save Changes
        </button>
      </div>
    </div>
  );
};

export default MinuteNoteDetail;
